package uk.ac.ed.inf;import org.junit.Before;import org.junit.Test;import uk.ac.ed.inf.controller.CoreRestController;import uk.ac.ed.inf.ilp.data.Restaurant;import java.io.IOException;public class RestTest {    private CoreRestController coreRestController;    @Before    public void setUp() throws IOException {        coreRestController = new CoreRestController("https://ilp-rest.azurewebsites.net");    }    @Test    public void testGetRestaurants(){        Restaurant[] restaurants = coreRestController.getRestaurants();        for (Restaurant restaurant : restaurants) {            System.out.println(restaurant);        }    }    @Test    public void testGetCentralArea(){        System.out.println(coreRestController.getCentralArea());    }    @Test    public void testGetNoFlyZones(){        System.out.println(coreRestController.getNoFlyZones());    }    @Test    public void testGetOrders(){        System.out.println(coreRestController.getOrders());    }    @Test    public void testGetOrdersForDate(){        System.out.println(coreRestController.getOrdersForDate("2023-09-01"));    }}